module.exports={info_panel:{title:{en:"Colombia mapper",es:"Mapeador de colombia"},info_sections:[{section_title:{en:null,es:null},section_content:{en:'<p>Welcome to Magdalena, Northern Colombia. Here, EO4cultivar, funded through the  International Partnership Programme, run by UK Space Agency, has identified places to focus action to deliver sustainable land management within river catchments of the Zona Bananera, reaching into the Sierra Nevada de Santa Marta.</p><p>The mapping concerns local priorities to reduce the risk of flooding and soil erosion and to improve ecological connectivity. Places where a land management intervention can benefit ecosystem services (e.g. by slowing runoff or restoring habitats) are identified. Deploying action in places that deliver multiple benefits is likely to be most cost-effective. The outputs of this work are suitable for any organisations aiming to undertake environmental improvement work in the area.</p><p>JNCC produced guidance on management actions that utilise practical, nature-based solutions, led stakeholder engagement and local capacity building in partnership with project partner, ASBAMA and their stakeholders. Environment Systems used their Spatial Evidence for Natural Capital Evaluation (SENCE) modelling approach to map existing natural capital and opportunities to enhance it, producing maps you can explore and download.</p><p>More <a href="https://jncc.gov.uk/our-work/eo4c-colombia">information on the project</a> is available on the website. <a href="https://hub.jncc.gov.uk/assets/fc25e10e-857b-4c08-a591-30fcd65d96dc">Data and reports</a> detailing the mapping process are available to download, as are <a href="https://hub.jncc.gov.uk/assets/fc25e10e-857b-4c08-a591-30fcd65d96dc">management guides</a> showing how the maps can be used to inform land management decisions.</p>',es:'<p>Bienvenidos al Magdalena, al norte de Colombia. AquÃ­, EO4cultivar, a travÃ©s de la financiaciÃ³n del IPP (International Partnership Programme), dirigido por UK Space Agency, ha identificado lugares donde se puede centrar la acciÃ³n a fin de lograr una gestiÃ³n sostenible de la tierra dentro de las cuencas fluviales de la Zona Bananera alcanzando la Sierra Nevada de Santa Marta.</p><p>El mapeo aborda las prioridades locales para reducir el riesgo de inundaciones y de erosiÃ³n del suelo, asÃ­ como mejorar la conectividad ecolÃ³gica. Se identificaron los lugares en donde una intervenciÃ³n de gestiÃ³n de suelos puede beneficiar a los servicios ecosistÃ©micos (por ejemplo; al frenar la escorrentÃ­a o al restaurar los hÃ¡bitats). Es probable que el despliegue de la acciÃ³n en lugares que ofrecen mÃºltiples beneficios sea lo mÃ¡s eficaz en funciÃ³n de los costos. Los productos de este trabajo son adecuados para cualquier organizaciÃ³n que tenga la intenciÃ³n de emprender trabajos de mejora medioambiental en el Ã¡rea.</p><p>JNCC produjo una guÃ­a sobre las medidas de gestiÃ³n que utilizan soluciones prÃ¡cticas basadas en la naturaleza, tambiÃ©n liderÃ³ la participaciÃ³n de los grupos de interÃ©s y la creaciÃ³n de capacidad local en asociaciÃ³n con un socio del proyecto, ASBAMA, asÃ­ como sus partes interesadas. Environment Systems utilizÃ³ su sistema de modelado de mapas SENCE (Evidencia Espacial para la EvaluaciÃ³n del Capital Natural, por sus siglas en inglÃ©s) para mapear el capital natural existente y las oportunidades para mejorarlo produciendo mapas que se pueden explorar y descargar.</p><p>MÃ¡s <a href="https://jncc.gov.uk/our-work/eo4c-colombia-lengua-espanola/">informaciÃ³n sobre el proyecto</a> estÃ¡ disponible en el sitio web. <a href="https://hub.jncc.gov.uk/assets/b996fb94-b5e9-4367-b3bd-34281eb2828b">Los datos y los informes</a> estÃ¡n disponibles para descargar, como son las <a href="https://hub.jncc.gov.uk/assets/b996fb94-b5e9-4367-b3bd-34281eb2828b">guÃ­as de gestion</a> demostrando cÃ³mo se pueden usar los mapas para informar las decisiones de gestiÃ³n de la tierra.</p>'}}],button_text:{en:"Get started",es:"Empezar"},opacity_slider:{en:"Opacity",es:"Opacidad"}},grid_panel:{info_sections:[{section_title:{en:"A summary of the data available in the selected area on the map",es:"Resumen de los datos disponibles en el Ã¡rea seleccionada en el mapa"},section_content:{en:'Use the layer selection on the left of the map to view the individual datasets in more detail. A thicker black outline represents the range of values present in a selected square for a given data layer. <svg class="legend-iconography" viewBox="0 0 10 10" xmlns="http://www.w3.org/2000/svg"><rect width="8" height="8" x="1" y="1" rx="1" fill="none" stroke="#000000" stroke-width="2"></rect></svg>',es:'Usa la selecciÃ³n de capas a la izquierda del mapa para observar con mayor detalle los datasets individuales. El delineado mÃ¡s grueso color negro representa el rango de valores presentes en un recuadro seleccionado para una capa de datos determinada. <svg class="legend-iconography" viewBox="0 0 10 10" xmlns="http://www.w3.org/2000/svg"><rect width="8" height="8" x="1" y="1" rx="1" fill="none" stroke="#000000" stroke-width="2"></rect></svg>'}}]},base_layers:{no_layer:{wms_name:"",legend_styles:[],short_title:{en:"No layer selected",es:"Ninguna capa seleccionada"},info_sections:[{section_title:{en:"",es:""},section_content:{en:"<p>Select a layer from the drop down to explore ecosystem service delivery and identify opportunities for enhancing ecosystem services in the region.</p><p><b>5k grid square with summary data:</b> This function splits the area of interest into 5km2 grids.  Select a 5km2 area you are interested in to display a summary of the ecosystem service delivery and enhancement opportunities within that 5km2.</p><p><b>Satellite Imagery:</b> This function shows the satellite images of the area of interest.</p><p><b>Zona Bananera:</b> This highlights the project's area of interest (outlined in red). The broad case study region was identified in consultation with key local stakeholders and is located within the Magdalena region in northern Colombia.</p><p><b>Rio Frio Catchment:</b> This highlights the sub-catchment area for the Rio Frio 'Cold River' (outlined in red).  This sub-catchment has been defined using modelling that identifies interconnected hydrological units within the overall area of interest.</p>",es:"<p>Seleccione una capa de la lista que se muestra a continuaciÃ³n para explorar la oferta de los servicios ecosistÃ©micos y las oportunidades en la regiÃ³n.</p><p>Marque la casilla correspondiente:</p><p><b>Ãrea de interÃ©s central (5km2) â Resumen de la data</b>: Esta funciÃ³n divide el mapa en una cuadrÃ­cula de 5km2. Seleccione una cuadrÃ­cula de 5km2 para mostrar un resumen de oferta y oportunidades de servicios ecosistÃ©micos dentro de esos 5km2. Al seleccionar distintas capas en la lista desplegable podrÃ¡ ver la ubicaciÃ³n de estos servicios en dicha cuadrÃ­cula.</p><p><b>ImÃ¡genes satelitales</b>: Esta funciÃ³n muestra las imÃ¡genes satelitales del Ã¡rea de interÃ©s.</p><p><b>Zona Bananera</b>: Se resalta el Ã¡rea de interÃ©s (delineado en rojo). La amplitud de la regiÃ³n del estudio de caso fue identificada en consulta con los grupos de interÃ©s locales clave y se ubica dentro de la regiÃ³n del Magdalena en la zona norte de Colombia. Se definiÃ³ en base a los lÃ­mites de la cuenca hidrolÃ³gica, la cual incluye la Zona Bananera. La Zona Bananera es de gran importancia econÃ³mica en la regiÃ³n del Magdalena y contiene varios productores tanto de escala comercial como pequeÃ±os.</p><p><b>Cuenca del RÃ­o FrÃ­o</b>: AquÃ­ se resalta el Ã¡rea de la cuenca para el RÃ­o FrÃ­o (delineado en rojo). La Cuenca del RÃ­o FrÃ­o se intersecta con las municipalidades de la CiÃ©naga, la Zona Bananera y Pueblo Viejo. AdemÃ¡s, abastece las actividades agrÃ­colas de la regiÃ³n.</p>"}}],attribution:{en:"",es:""}},habitat_map:{wms_name:"colombia_eo4_cultivar:Colombia_habitat_map_20191127_Final",legend_styles:[],short_title:{en:"Habitat map",es:"Mapa de hÃ¡bitat"},info_sections:[{section_title:{en:"Habitat map",es:"Mapa de hÃ¡bitat"},section_content:{en:"<p>A habitat map has been produced for the study region within the Magdalena department of Colombia. This provides a baseline of type, extent and distribution of current land use and habitats.  These natural assets are ecologically and hydrologically connected throughout the watershed within the area of interest. The map can be used to help inform catchment-scale planning for sustainable land-use, focused land management interventions, and subsequent policy decisions. The map was developed for use as an input dataset for ecosystem service, risk and opportunity analyses.</p><p>The current map is based on 20 m resolution Sentinel 1 and Sentinel 2 imagery and 30 m resolution elevation data.</p>",es:"<p>Se creÃ³ un mapa de hÃ¡bitat para la regiÃ³n de estudio dentro del departamento del Magdalena en Colombia. Esto nos proporciona una lÃ­nea base de tipo, extensiÃ³n y distribuciÃ³n del uso actual de los suelos y hÃ¡bitats. Estos activos naturales estÃ¡n ecolÃ³gica e hidrolÃ³gicamente conectados a lo largo de la cuenca dentro del Ã¡rea de interÃ©s. El mapa puede usarse para ayudar a informar la planificaciÃ³n a escala de cuenca para el uso sostenible de la tierra, intervenciones centradas en la gestiÃ³n de la tierra y subsiguientes decisiones polÃ­ticas. El mapa fue desarrollado para su uso como conjunto de datos de entrada para los servicios ecosistÃ©micos y el anÃ¡lisis de riesgo y oportunidades.</p><p>El mapa actual se basa en imÃ¡genes de una resoluciÃ³n de 20m del Sentinel 1 y Sentinel 2, ademÃ¡s de datos de elevaciÃ³n de una resoluciÃ³n de 30m.</p>"}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019) Derived from: Sentinel-1 and Sentinel-2 imagery: European Space Agency Elevation data: USGS Shuttle Radar Topography Mission",es:"Data and maps created by Environment Systems Ltd (2019) Derived from: Sentinel-1 and Sentinel-2 imagery: European Space Agency Elevation data: USGS Shuttle Radar Topography Mission"}},water_runoff_moderation:{wms_name:"colombia_eo4_cultivar:colombia_surface_water_regulation_stock",legend_styles:[],short_title:{en:"Ability of the land to moderate surface water runoff",es:"La habilidad del suelo para regular la escorrentÃ­a superficial"},info_sections:[{section_title:{en:"Ability of the land to moderate surface water runoff",es:"La habilidad del suelo para regular la escorrentÃ­a superficial"},section_content:{en:"<i>Ecosystem service: Regulation of overland flow.</i>",es:"<i>Servicio ecosistÃ©mico: RegulaciÃ³n de la escorrentÃ­a superficial.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"The darkest colours represent where the land makes the greatest contribution to slowing over-land water flow after heavy rainfall events. This helps prevent flooding.",es:"Los colores mÃ¡s oscuros indican donde la tierra logra una mayor contribuciÃ³n para retardar el flujo de la escorrentÃ­a superficial luego de fuertes precipitaciones. Esto ayuda a prevenir las inundaciones."}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"Vegetation can help water soak into the ground and can also form a barrier to water moving rapidly over the land surface. This helps reduce the amount of surface water that can cause flooding. Flat land holds water whilst steep slopes shed water. Some types of soil can hold a lot of water, particularly in wetlands, whilst others hold very little, so soil and geology are important influencing factors.",es:"La vegetaciÃ³n ayuda a que el agua sea absorbida en el suelo y tambiÃ©n puede formar una barrera en contra del agua que avanza rÃ¡pidamente sobre la superficie de la tierra. Esto ayuda a reducir la cantidad de agua superficial que puede causar inundaciones. Los terrenos llanos retienen el agua, mientras que las pendientes pronunciadas la desaguan. Algunos tipos de suelo pueden contener mucha agua, especialmente en los humedales, mientras que otros tipos contienen muy poco, por lo que el suelo y la geologÃ­a son factores influyentes importantes."}},{section_title:{en:"Why it is important:",es:"Por quÃ© es importante:"},section_content:{en:"Surface water regulation is a form of natural flood management where hydrological and morphological processes together with the habitat features work together to manage the sources and pathways for flood waters.",es:"La regulaciÃ³n de las aguas superficiales es una forma de manejo natural de inundaciones en donde los procesos hidrolÃ³gicos y morfolÃ³gicos junto con las caracterÃ­sticas del hÃ¡bitat trabajan en conjunto para manejar las fuentes y las vÃ­as con relaciÃ³n al agua de las inundaciones."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:"This map was generated by assessing key factors at each location: geology, soil, slope, habitat and management. Datasets representing each key factor were scored based on their functional contribution to mechanisms for natural regulation of overland flow: infiltration; interception; storage and sediment load control. Once scored, the datasets were combined. The current map has been created at the strategic scale and is indicative at a field level. Field visits should be made before any site-specific management decisions are taken. Additional data could be sourced to refine the maps at the local scale; methods for doing this are discussed in the project report.",es:"Este mapa se creÃ³ al evaluar los factores clave en cada ubicaciÃ³n: geologÃ­a, suelo, pendientes, hÃ¡bitat y gestiÃ³n. Los datasets que representan a cada factor clave se calificaron en base a su contribuciÃ³n funcional para los mecanismos de regulaciÃ³n natural de la escorrentÃ­a superficial: infiltraciÃ³n, interceptaciÃ³n, almacenamiento y control de la carga de sedimentos. Luego, una vez que los datasets fueron calificados, se combinaron. El mapa actual fue creado a escala estratÃ©gica y es indicativo a nivel de campo. Se deben hacer visitas de campo antes de tomar cualquier decisiÃ³n de manejo de sitio. Se podrÃ­an obtener datos adicionales para mejorar los mapas a escala local. Los mÃ©todos que se usaron para este trabajo son mencionados en el informe del proyecto."}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019). Soil data: Geographic Institute Agustin Codazzi",es:"Datos y mapas creados por Environment Systems Ltd (2019). Datos de suelo: Instituto GeogrÃ¡fico AgustÃ­n Codazzi."}},woodland_ecological_connectivity:{wms_name:"colombia_eo4_cultivar:colombia_woodland_ecosystem_connectivity",legend_styles:[],short_title:{en:"Ecological Network Connectivity - Woodland Ecosystem",es:"Conectividad de red ecolÃ³gica â Ecosistema forestal"},info_sections:[{section_title:{en:"Ecological Network Connectivity - Woodland Ecosystem",es:"Conectividad de red ecolÃ³gica â Ecosistema forestal"},section_content:{en:"<i>Ecosystem service: Population maintenance & genetic diversity.</i>",es:"<i>Servicio ecosistÃ©mico: Mantenimiento de la poblaciÃ³n & diversidad genÃ©tica.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"Dark green areas are more highly connected to the ecological network. Grey areas are existing source woodlands (excludes disturbed woodlands).",es:"Las Ã¡reas de color verde oscuro estÃ¡n mÃ¡s conectadas con la red ecolÃ³gica. Las Ã¡reas de color gris indican bosques ya existentes (excluye los bosques intervenidos)."}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"The map shows the existing woodland network within which plant and animal species can move to maintain genetic diversity and sustain viable populations of woodland species. Existing woodlands act as 'source habitat', where the main population of woodland species is based. Land adjoining and close to the source habitats can be used for foraging and as dispersal routes (permeable habitats). Some habitats and land uses are more permeable than others; for example, scrub could be expected to provide greater levels of food and shelter for woodland species, whereas bare ground would provide less.",es:"El mapa muestra la red forestal existente dentro de la cual especies animales y vegetales pueden movilizarse para mantener la diversidad genÃ©tica y sostener poblaciones viables de especies forestales. Los bosques ya existentes actÃºan como 'hÃ¡bitat fuente' donde se encuentra basada la poblaciÃ³n principal de especies forestales. Los terrenos contiguos y cercanos a los hÃ¡bitats fuente pueden servir para la bÃºsqueda de alimento y como rutas de dispersiÃ³n (hÃ¡bitats permeables). Algunos hÃ¡bitats y usos de suelo son mÃ¡s permeables que otros; por ejemplo, se podrÃ­a esperar que los matorrales aporten un buen nivel de alimentos y refugio para especies forestales, mientras que un suelo sin vegetaciÃ³n aportarÃ­a menos."}},{section_title:{en:"Why it is important:",es:"Por quÃ© es importante:"},section_content:{en:"Areas of native natural and semi-natural woodlands that are connected in a landscape, forming a network, are more resilient to changing climate or land management. Inside the network, woodlands generally provide higher levels of ecosystem services, such as the ability to clean water or regulate runoff, provide timber products and support nature tourism (e.g.  bird watching). Within the network, restoration of structurally-diverse and species-rich woodlands will be far more effective as propagules, pollinators and important species will be available for colonisation.",es:"Las Ã¡reas de bosques nativos naturales y seminaturales que estÃ¡n conectadas en un entorno que forma una red, son mÃ¡s resilientes al cambio climÃ¡tico o al manejo de suelos. Dentro de la red, los bosques por lo general proveen altos niveles de servicios ecosistÃ©micos, tales como la capacidad para limpiar el agua o regular la escorrentÃ­a, brindar productos madereros y apoyar el turismo natural (avistamiento de aves). Dentro de la red, la restauraciÃ³n de los bosques estructuralmente diversos y ricos en especies serÃ¡ mucho mÃ¡s eficaz ya que se dispondrÃ¡ de propÃ¡gulos, polinizadores y especies importantes para la colonizaciÃ³n."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:"The habitat classes were generated using Sentinel 1 and Sentinel 2 satellite imagery. Each habitat and land use was evaluated for its importance and role played in supporting the woodland network.",es:"Las clases de hÃ¡bitat se generaron usando las imÃ¡genes satelitales de Sentinel 1 y Sentinel 2. Se evalÃºo cada hÃ¡bitat y uso de suelo segÃºn su importancia y el rol que juega en el apoyo a la red forestal."}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019)",es:"Datos y mapas creados por Environment Systems Ltd (2019)"}},wetland_ecological_connectivity:{wms_name:"colombia_eo4_cultivar:colombia_wetland_ecosystem_connectivity",legend_styles:[],short_title:{en:"Ecological Network Connectivity - Wetland Ecosystem",es:"Conectividad de red ecolÃ³gica â Ecosistema de humedales"},info_sections:[{section_title:{en:"Ecological Network Connectivity - Wetland Ecosystem",es:"Conectividad de red ecolÃ³gica â Ecosistema de humedales"},section_content:{en:"<i>Ecosystem service: Population maintenance & genetic diversity.</i>",es:"<i>Servicio ecosistÃ©mico: Mantenimiento de la poblaciÃ³n & diversidad genÃ©tica.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"Darker blue areas are more highly connected to the ecological network. Black areas are existing source habitats, comprising the wetland, mangrove and waterbody habitats (except artificial waterbodies).",es:"Las Ã¡reas de color azul oscuro estÃ¡n altamente conectadas a la red ecolÃ³gica. Las Ã¡reas de color negro seÃ±alan los humedales fuente existentes (excluye humedales artificiales)."}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"The map shows the existing wetland network within which plant and animal species can move to maintain genetic diversity and sustain viable populations of wetland species. Existing wetlands act as 'source habitat', where the main population of wetland species is based. Land adjoining and close to the source habitats can be used for foraging and as dispersal routes (permeable habitats). Some habitats and land uses are more permeable than others; for example, rivers could be expected to provide suitable conditions for many wetland species, whereas terrestrial habitats are less suitable.",es:"El mapa muestra la red de humedales existentes dentro de la cual especies animales y vegetales pueden movilizarse para mantener la diversidad genÃ©tica y sostener poblaciones viables de especies de humedal. Los humedales ya existentes actÃºan como 'hÃ¡bitat fuente' donde se encuentra ubicada la poblaciÃ³n principal de especies de humedal. Los terrenos contiguos y cercanos a los hÃ¡bitats fuente pueden servir para la bÃºsqueda de alimento y como rutas de dispersiÃ³n (hÃ¡bitats permeables). Algunos hÃ¡bitats y usos de suelo son mÃ¡s permeables que otros; por ejemplo, se podrÃ­a esperar que los rÃ­os aporten condiciones apropiadas para para varias especies de humedal, mientras que el hÃ¡bitat terrestre es menos apropiado."}},{section_title:{en:"Why it is important:",es:"Por quÃ© es importante:"},section_content:{en:"Areas of native natural and semi-natural wetlands that are connected in a landscape, are more resilient to changing climate or land management. Inside the network, wetlands with low chemical and nutrient levels, and structurally-diverse and species-rich emergent vegetation, generally provide a higher level of ecosystem services, such as clean freshwaters, erosion control, and nursery fisheries. Within the network, restoration of structurally-diverse and species-rich emergent vegetation will be far more effective as propagules, pollinators and important species will be available for colonisation.",es:"Las Ã¡reas de humedales nativos naturales y seminaturales que estÃ¡n conectadas en un entorno, son mÃ¡s resilientes al cambio climÃ¡tico o al manejo de suelos. Dentro de la red, los humedales con bajos niveles nutrientes quÃ­micos NAD y la vegetaciÃ³n emergente estructuralmente diversa y rica en especies, generalmente brinda un mayor nivel de servicios ecosistÃ©micos, tales como: agua dulce limpia, control de la erosiÃ³n y criaderos de peces. Dentro de la red, la restauraciÃ³n de la vegetaciÃ³n emergente estructuralmente diversa y rica en especies serÃ¡ mucho mÃ¡s eficaz ya que se dispondrÃ¡ de propÃ¡gulos, polinizadores y especies importantes para la colonizaciÃ³n."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:"The habitat classes were generated using Sentinel 1 and Sentinel 2 satellite imagery. Each habitat and land use was evaluated for its importance and role played in supporting the wetland network.",es:"Las clases de hÃ¡bitat se crearon usando imÃ¡genes satelitales de Sentinel 1 y Sentinel 2. Cada hÃ¡bitat y uso de suelo fue evaluado por su importancia y el rol que juega en el apoyo a la red de humedales."}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019)",es:"Datos y mapas creados por Environment Systems Ltd (2019)"}},grassland_ecological_connectivity:{wms_name:"colombia_eo4_cultivar:colombia_grassland_ecosystem_connectivity",legend_styles:[],short_title:{en:"Ecological Network Connectivity - Grassland Ecosystem",es:"Conectividad de red ecolÃ³gica â Ecosistema de pastizales"},info_sections:[{section_title:{en:"Ecological Network Connectivity - Grassland Ecosystem",es:"Conectividad de red ecolÃ³gica â Ecosistema de pastizales"},section_content:{en:"<i>Ecosystem services: Population maintenance & genetic diversity.</i>",es:"<i>Servicio ecosistÃ©mico: Mantenimiento de la poblaciÃ³n & diversidad genÃ©tica.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"Darker orange areas are more highly connected to the ecological network. Black areas are existing source grasslands.",es:"Las Ã¡reas de color naranja oscuro estÃ¡n altamente conectadas a la red ecolÃ³gica. Las Ã¡reas de color negro seÃ±alan los pastizales fuente existentes."}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"The map shows the existing grassland network within which plant and animal species can move to maintain genetic diversity and sustain viable populations of grassland species. Existing grasslands act as 'source habitat', where the main population of grassland species is based. Land adjoining and close to the source habitats can be used for foraging and as dispersal routes (permeable habitats). Some habitats and land uses are more permeable than others; for example, scattered scrub could be expected to provide better conditions for grassland species than dense woodland.",es:"El mapa muestra la red de pastizales existentes dentro de la cual especies animales y vegetales pueden movilizarse para mantener la diversidad genÃ©tica y sostener poblaciones viables de especies de pastizal. Los pastizales existentes actÃºan como 'hÃ¡bitat fuente' donde se encuentra ubicada la poblaciÃ³n principal de especies de pastizal. Los terrenos contiguos y cercanos a los hÃ¡bitats fuente pueden servir para la bÃºsqueda de alimento y como rutas de dispersiÃ³n (hÃ¡bitats permeables). Algunos hÃ¡bitats y usos de suelo son mÃ¡s permeables que otros; por ejemplo, se podrÃ­a esperar que el matorral disperso brinde mejores condiciones para las especies de pastizal que el bosque denso."}},{section_title:{en:"Why it is important:",es:"Por quÃ© es importante:"},section_content:{en:"Areas of native natural and semi-natural grasslands that are connected in a landscape, are more resilient to changing climate or land management. Inside the network, structurally-diverse and species-rich grasslands generally provide a higher level of ecosystem services, such as surface water regulation. Within the network, restoration of structurally-diverse and species-rich grasslands will be far more effective as propagules, pollinators and important species will be available for colonisation.",es:"Las Ã¡reas de pastizales nativos naturales y seminaturales que estÃ¡n conectadas en un entorno, son mÃ¡s resilientes al cambio climÃ¡tico o al manejo de suelos. Dentro de la red, los pastizales estructuralmente diversos y ricos en especies generalmente brindan un mayor nivel de servicios ecosistÃ©micos, tales como: la regulaciÃ³n de las aguas superficiales. Dentro de la red, la restauraciÃ³n de pastizales estructuralmente diversos y ricos en especies serÃ¡ mucho mÃ¡s eficaz ya que se dispondrÃ¡ de propÃ¡gulos, polinizadores y especies importantes para la colonizaciÃ³n."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:"The habitat classes were generated using Sentinel 1 and Sentinel 2 satellite imagery. Each habitat and land use was evaluated for its importance and role played in supporting the grassland network.",es:"Las clases de hÃ¡bitat se generaron usando las imÃ¡genes satelitales de Sentinel 1 y Sentinel 2. Se evalÃºo cada hÃ¡bitat y uso de suelo segÃºn su importancia y el rol que juega en el apoyo a la red de pastizales."}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019)",es:"Datos y mapas creados por Environment Systems Ltd (2019)"}},ecological_opportunities:{wms_name:"colombia_eo4_cultivar:colombia_all_habitat_opportunities",legend_styles:[],short_title:{en:"Opportunities to strengthen ecological networks",es:"Oportunidades para fortalecer las redes ecolÃ³gicas"},info_sections:[{section_title:{en:"Opportunities to strengthen ecological networks",es:"Oportunidades para fortalecer las redes ecolÃ³gicas"},section_content:{en:"<i>Ecosystem service: Population maintenance & genetic diversity.</i>",es:"<i>Servicio EcosistÃ©mico: Mantenimiento del ciclo de vida & diversidad genÃ©tica.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"The map shows places where it should be possible to restore or create new habitat to strengthen the existing ecological networks, to enhance biological and genetic diversity. Places in darker shades are areas where habitat restoration/ creation are expected to be most easily implemented and more successful. For example, developing a woodland from an area of dense scrub or bare ground may be a suitable choice in both places, but is quicker, less labour intensive and less costly from the dense scrub vegetation.",es:"El mapa muestra lugares donde serÃ­a posible restaurar o crear nuevos hÃ¡bitats para fortalecer las redes de pastizales, humedales y bosques existentes, para mejorar la biodiversidad biolÃ³gica y genÃ©tica. Los lugares con sombras mÃ¡s oscuras son las Ã¡reas donde se espera que la restauraciÃ³n o creaciÃ³n de hÃ¡bitat sea mÃ¡s fÃ¡cil de implementar y mÃ¡s exitosa. Por ejemplo, el desarrollo de un bosque en una zona de matorral denso o de suelo desnudo puede ser adecuado en ambos lugares, sin embargo, serÃ­a mÃ¡s rÃ¡pido, menos laborioso y menos costoso debido a la densa vegetaciÃ³n de matorral."}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"Biodiversity is a supporting service which underpins many other ecosystem services.",es:"La biodiversidad es un servicio de apoyo que sustenta muchos otros servicios ecosistÃ©micos."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:"This map considered all places in close proximity to existing source habitat; these areas are most likely to be effective at supporting existing populations. Habitats and land use within this proximity zone were assessed as to the ease with which they could be restored to support the ecological networks. Where restoration to woodland was possible, this option was always chosen. In other places, where restoration to either grassland or wetland is possible, this is indicated.",es:"Este mapa considera todas las Ã¡reas cercanas a hÃ¡bitats originales, ya que es muy probable que estas Ã¡reas sean eficaces para sustentar a las poblaciones existentes. Los hÃ¡bitats y el uso de la tierra dentro de esta zona de proximidad fueron evaluados en cuanto a la facilidad con la que podrÃ­an ser restaurados para apoyar a las redes ecolÃ³gicas. En los casos en que la restauraciÃ³n del bosque ha sido posible, siempre se optÃ³ por esta opciÃ³n. En otros lugares, donde es posible la restauraciÃ³n de pastizales o humedales, esto se indica."}}],attribution:{en:"Data and maps created by Environment Systems Ltd ",es:"Datos y mapas creados por Environment Systems Ltd (2019)"}},priority_ecological_opportunities:{wms_name:"colombia_eo4_cultivar:colombia_habitat_opportunities_next_to_existing_source_habitat",legend_styles:[],short_title:{en:"Opportunities to strengthen ecological networks: priority places for action (those adjoining existing key habitats of high-biodiversity value)",es:"Oportunidades para fortalecer las redes ecolÃ³gicas: lugares prioritarios para tomar acciÃ³n (sitios adyacentes a hÃ¡bitats clave existentes de alto valor de biodiversidad)"},info_sections:[{section_title:{en:"Opportunities to strengthen ecological networks: priority places for action (those adjoining existing key habitats of high-biodiversity value)",es:"Oportunidades para fortalecer las redes ecolÃ³gicas: lugares prioritarios para tomar acciÃ³n (sitios adyacentes a hÃ¡bitats clave existentes de alto valor de biodiversidad)"},section_content:{en:"<i>Ecosystem service: Population maintenance & genetic diversity.</i>",es:"<i>Servicio EcosistÃ©mico: Mantenimiento de la poblaciÃ³n & diversidad genÃ©tica.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:'This map is a subset of the "Opportunities to strengthen ecological networks" map and shows only those places that adjoin existing source habitat, where habitat restoration is likely to be most successful and beneficial to existing habitat of key biodiversity value. Areas next to existing biodiversity hotspots are likely to provide most benefit to existing species populations, allowing the expansion of local native species via dispersal or territory expansion. Restoration of structurally-diverse and species-rich habitat will be far more effective close to the source habitats, as propagules, pollinators and important species will be available for colonisation.',es:'El mapa es un subconjunto del Mapa "Oportunidades para fortalecer las redes ecolÃ³gicas" y muestra solo aquellos lugares que estÃ¡n adyacentes a un hÃ¡bitat original existente, donde es muy probable que la restauraciÃ³n del hÃ¡bitat sea mÃ¡s exitosa y beneficiosa para el hÃ¡bitat existente de valor clave para la biodiversidad. Es probable que las Ã¡reas prÃ³ximas a los principales centros de biodiversidad existentes proporcionen mayores beneficios a las poblaciones de especies existentes, permitiendo la expansiÃ³n de especies nativas locales a travÃ©s de su dispersiÃ³n o la expansiÃ³n del territorio. La restauraciÃ³n de hÃ¡bitats estructuralmente diversos y ricos en especies serÃ¡ mucho mÃ¡s eficaz cerca de los hÃ¡bitats originales, ya que se dispondrÃ¡ de propÃ¡gulos, polinizadores y especies importantes para la colonizaciÃ³n.'}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"Biodiversity is a supporting service which underpins many other ecosystem services such as soil quality, pollination and food provision.",es:"La biodiversidad es un servicio de apoyo que sustenta muchos otros servicios ecosistÃ©micos, tales como la calidad del suelo, la polinizaciÃ³n y el suministro de alimentos."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:"This map considered places immediately adjoining existing source habitat, as defined by the ecological network maps in this series. Habitats and land uses next to the source habitats were assessed as to the ease at which they could be restored to support the grassland, wetland or woodland network.",es:"Este mapa considerÃ³ las Ã¡reas inmediatamente cercanas a hÃ¡bitats originales existentes, tal y como se define por los mapas de la red ecolÃ³gica de esta serie. Se evaluaron los hÃ¡bitats y los usos del suelo prÃ³ximos a los hÃ¡bitats originales en cuanto a la facilidad con que podrÃ­an restaurarse para el sustento de la red de pastizales, humedales o bosques."}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019)",es:"Datos y mapas creados por Environment Systems Ltd (2019)"}},water_regulation_opportunities:{wms_name:"colombia_eo4_cultivar:colombia_RioFrio_all_ops_to_enhance_surface_water_reg",legend_styles:[],short_title:{en:"Opportunities to enhance surface water regulation in the Rio Frio catchment",es:"Oportunidades para mejorar la regulaciÃ³n de las aguas superficiales en la zona de captaciÃ³n del RÃ­o FrÃ­o"},info_sections:[{section_title:{en:"Opportunities to enhance surface water regulation in the Rio Frio catchment",es:"Oportunidades para mejorar la regulaciÃ³n de las aguas superficiales en la zona de captaciÃ³n del RÃ­o FrÃ­o"},section_content:{en:"<i>Ecosystem service: Regulation of overland flow.</i>",es:"<i>Servicio EcosistÃ©mico: RegulaciÃ³n de la escorrentÃ­a superficial.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"This map shows places with agriculture and grassland where it would be possible to improve surface water regulation to slow the flow of runoff into the river Frio. Places shown in dark blue are located in the upper catchment of the Rio Frio. Places shown in light blue are in the mid-catchment, and places shown in green are in the lower catchment. All of the coloured areas on the map are hydrologically connected, and action taken in these areas should enhance the existing water regulation capacity of the land. However, the types of action that are most appropriate, and whether these are logistically possible and cost-effective, depend on the position of the opportunity within the catchment.",es:"Este mapa muestra lugares con agricultura y pastizales en donde serÃ­a posible mejorar la regulaciÃ³n superficial del agua para retardar el flujo de la escorrentÃ­a hacia el RÃ­o FrÃ­o. Los lugares de color azul oscuro estÃ¡n ubicados en la cuenca alta del RÃ­o FrÃ­o. Los lugares en color azul claro se encuentran en la parte media de la cuenca y los de color verde, en la cuenca baja. Todas las Ã¡reas de color en el mapa estÃ¡n hidrolÃ³gicamente conectadas, por lo que las medidas adoptadas en estos sectores deberÃ­an mejorar la capacidad existente de la regulaciÃ³n del agua. No obstante, los tipos de acciÃ³n que serÃ­an mÃ¡s apropiados, y ya sea que fuesen logÃ­sticamente posibles y rentables, dependen de la posiciÃ³n de la oportunidad dentro de la cuenca."}},{section_title:{en:"Why is it important:",es:"Por quÃ© es importante:"},section_content:{en:"Generally, interventions in the mid- and upper-reaches of the catchment (light and dark blue) will benefit a larger downstream area, but can be more challenging to implement, e.g. due to topography and accessibility. In the lower reaches of the catchment the effects of management intervention become more localised (as there is less downstream area), but can be easier to achieve. In the lower reaches of the river wetland creation can enhance the capacity of land to store flood waters and limit their spread, which might protect valuable assets and infrastructure. In the upper reaches afforestation can slow the volume and rate at which water enters the watercourses.",es:"Por lo general, las intervenciones en la zona media y alta de la cuenca (azul claro y oscuro) beneficiarÃ¡n un Ã¡rea grande de aguas abajo, pero puede ser mÃ¡s difÃ­cil de implementar, por ejemplo, debido a la topografÃ­a y la accesibilidad. En las partes mÃ¡s bajas del Ã¡rea de captaciÃ³n, los resultados de la intervenciÃ³n del manejo se vuelven mÃ¡s localizados (ya que hay menos Ã¡rea de aguas abajo), pero mÃ¡s fÃ¡ciles de lograr. En los tramos inferiores del rÃ­o, la creaciÃ³n de humedales puede aumentar la capacidad de la tierra para almacenar las aguas de las inundaciones y restringir su velocidad, lo que podrÃ­a proteger valiosos bienes e infraestructura. En los tramos superiores, la forestaciÃ³n puede ralentizar el volumen y la velocidad con la que el agua entra en los cursos de agua."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:"This map was created by analysing the restoration potential of habitat and land use classes generated using Sentinel 1 and Sentinel 2 satellite imagery. The river basin boundary was determined by analysis of SRTM elevation data.",es:"Este mapa fue creado al analizar el potencial de restauraciÃ³n del hÃ¡bitat y de las clases de uso del suelo gracias a las imÃ¡genes satelitales de Sentinel 1 y Sentinel 2. La delimitaciÃ³n de la cuenca hidrogrÃ¡fica se determinÃ³ por un anÃ¡lisis de datos de elevaciÃ³n SRTM."}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019)",es:"Datos y mapas creados por Environment Systems Ltd (2019)"}},water_regulation_opportunities_high_volume:{wms_name:"colombia_eo4_cultivar:colombia_riofrio_ops_to_enhance_surface_water_reg_receiving_high_flow_volume",legend_styles:[],short_title:{en:"Opportunities to enhance surface water regulation in the Rio Frio catchment: places receiving high volumes of surface water flow",es:"Oportunidades para mejorar la regulaciÃ³n de las aguas superficiales en la zona de captaciÃ³n del RÃ­o FrÃ­o: sitios limÃ­trofes de los principales canales de drenaje"},info_sections:[{section_title:{en:"Opportunities to enhance surface water regulation in the Rio Frio catchment: places receiving high volumes of surface water flow",es:"Oportunidades para mejorar la regulaciÃ³n de las aguas superficiales en la zona de captaciÃ³n del RÃ­o FrÃ­o: sitios limÃ­trofes de los principales canales de drenaje"},section_content:{en:"<i>Ecosystem service: Regulation of overland flow.</i>",es:"<i>Servicio EcosistÃ©mico: RegulaciÃ³n de la escorrentÃ­a superficial.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"This map shows places that are currently agriculture or grassland within major flow paths, where taking action to improve surface water regulation, to slow the flow of runoff into the river Frio, would be most effective. Dark brown places directly adjoin a major river, tributary or channel. They receive the largest proportion of the runoff water and may be more likely to flood; action should be most effective here. Lighter orange places are also within major flow paths but have less influence on flow into the major channels.",es:"Este mapa muestra lugares que actualmente se usan en la agricultura y como pastizales, en donde tomar acciÃ³n para mejorar la regulaciÃ³n de las aguas superficiales para retardar el flujo de la escorrentÃ­a hacia el RÃ­o FrÃ­o serÃ­a mÃ¡s eficaz. Los sitios de color marrÃ³n oscuro estÃ¡n dentro de subcuencas que colindan directamente con un rÃ­o principal, afluente o canal; por ello, la acciÃ³n a tomar serÃ­a mÃ¡s eficaz aquÃ­. Los sitios de color naranja claro tambiÃ©n se encuentran dentro de las principales corrientes, pero no colindan directamente con un canal principal."}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"Water regulation is a form of Natural Flood Management where hydrological and morphological processes, along with vegetation type, together manage the sources and pathways for flood waters.",es:"La regulaciÃ³n del agua es una forma de la GestiÃ³n Natural de Inundaciones en donde los procesos hidrolÃ³gicos y morfolÃ³gicos, y el tipo de vegetaciÃ³n presente, trabajan juntos para manejar las fuentes y vÃ­as de evacuaciÃ³n de las aguas de inundaciones."}},{section_title:{en:"Why it is important:",es:"Por quÃ© es importante:"},section_content:{en:"Generally, interventions higher up the catchment should benefit a larger area downstream, but can be more challenging to implement (e.g. due to topography and accessibility). In the lower reaches of the catchment the effects of management intervention become more localised (as there is less downstream area), but may be necessary to protect important assets/infrastructure. In all parts of the catchment, considering the location of major flow paths and places adjacent to channels will assist assessment of risk, and the value of benefits derived from taking action in different locations.",es:"Por lo general, las intervenciones en la zona alta de la cuenca deberÃ­an beneficiar a una zona mÃ¡s extensa aguas abajo. Sin embargo, las intervenciones en los tramos medios y altos de la cuenca pueden ser mÃ¡s difÃ­ciles de implementar (por ejemplo; debido la topografÃ­a y a la accesibilidad). En los tramos mÃ¡s bajos de la cuenca, los efectos de la intervenciÃ³n de gestiÃ³n pueden ser mÃ¡s localizados (ya que hay menos zonas de aguas abajo). En todas las partes de la cuenca los beneficios de acciÃ³n pueden maximizarse al apuntar a las Ã¡reas mÃ¡s cercanas a las vÃ­as de flujo principales (mostradas en marrÃ³n)."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:"This map was created by analysing the restoration potential of habitat and land use classes generated using Sentinel 1 and Sentinel 2 satellite imagery, and flow paths derived from SRTM elevation data.",es:"Este mapa fue creado al analizar el potencial de restauraciÃ³n del hÃ¡bitat y de las clases de uso del suelo gracias a las imÃ¡genes satelitales de Sentinel 1 y Sentinel 2. Esto ha sido combinado con un anÃ¡lisis de datos de elevaciÃ³n SRTM para determinar cuencas y subcuencas hidrolÃ³gicas."}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019). Sentinel-2 image: European Space Agency - ESA",es:"Datos y mapas creados por Environment Systems Ltd (2019). Imagen del Sentinel-2: Agencia Espacial Europea - ESA"}},precipitation_erosion_risk:{wms_name:"colombia_eo4_cultivar:colombia_precip_soil_erosion_risk",legend_styles:[],short_title:{en:"Risk of soil erosion in the Sierra Nevada caused by precipitation",es:"Riesgo de erosiÃ³n del suelo en la Sierra Nevada causado por lluvias"},info_sections:[{section_title:{en:"Risk of soil erosion in the Sierra Nevada caused by precipitation",es:"Riesgo de erosiÃ³n del suelo en la Sierra Nevada causado por lluvias"},section_content:{en:"<i>Ecosystem services: Conservation of soil and water quality. Limiting sediment entering rivers.</i>",es:"<i>Servicios ecosistÃ©micos: conservaciÃ³n del suelo y calidad del agua. LimitaciÃ³n de los sedimentos que entran a los rÃ­os.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"Places of highest risk are coloured red. Places of lower risk are coloured blue.",es:"Los sitios de mÃ¡s alto riesgo estÃ¡n seÃ±alados de color rojo. Los sitios en menor riesgo se muestran en color azul."}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"Land erosion risk is a significant factor leading to loss of soil, soil quality degradation, siltation of rivers, damage to habitats and wildlife, and damage to buildings, roads, and other infrastructure.",es:"El riesgo de la erosiÃ³n del suelo es un factor importante que conduce a la pÃ©rdida de suelo, la degradaciÃ³n de la calidad del suelo, la sedimentaciÃ³n de rÃ­os, daÃ±o a los hÃ¡bitats y a la vida silvestre, daÃ±o a las edificaciones, carreteras y otro tipo de infraestructura."}},{section_title:{en:"Why it is important:",es:"Por quÃ© es importante:"},section_content:{en:"Soil is a non-renewable resource and where it is lost through erosion, it can take hundreds to thousands of years to re-form. Losing soil disrupts the physical structure of the soil and the balance of biological communities which regulate soil functions, degrading soil quality. Nutrients and chemicals in the soil can be detrimental to the freshwater, wetland and marine habitats they reach, as well as the associated wildlife.",es:"El suelo es un recurso no renovable y en donde se haya perdido por erosiÃ³n puede tomar de cientos a miles de aÃ±os para volver a formarse. La pÃ©rdida del suelo altera la estructura fÃ­sica del mismo y el balance de comunidades biolÃ³gicas, que regulan las funciones del suelo, degradando asÃ­ la calidad del suelo. Los nutrientes y quÃ­micos en el suelo pueden ser perjudiciales para el agua dulce, los humedales y los hÃ¡bitats marinos a los que alcancen, asÃ­ como a la fauna silvestre asociada."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:"<p>This map was created using SCIMAP which is a framework for modelling and mapping diffuse pollution risk across landscapes. It considers slope, habitats and average precipitation. The map has been created using SRTM, WorldClim, Sentinel 1 and Sentinel 2 data.</p><p>The current map has been created at the strategic scale and is indicative at a field level. Field visits should be undertaken before any site-specific management decisions are taken. Additional data could be sourced to refine the maps at the local scale; methods for doing this are discussed in the project report.</p>",es:"Este mapa fue creado usando SCIMAP el cual es un marco para la modelizaciÃ³n y el mapeo del riesgo poblacional disperso en los distintos entornos naturales. Se considera a la pendiente, los hÃ¡bitats y la precipitaciÃ³n promedio. El mapa ha sido creado usando tambiÃ©n datos SRTM, WorldClim, Sentinel 1 y Sentinel 2. El mapa actual ha sido creado a escala estratÃ©gica y es indicativo a nivel de campo. Se deben realizar visitas de campo antes de tomar cualquier decisiÃ³n de gestiÃ³n de sitios especÃ­ficos. Se podrÃ­an obtener datos adicionales para mejorar los mapas a escala local. Los mÃ©todos que se usaron para este trabajo son mencionados en el informe del proyecto."}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019) SCIMAP by Sim Reaney, Durham University is licensed under a Creative Commons Attribution-NonCommercial-ShareAlike 3.0 Unported License",es:"Datos y mapas creados por Environment Systems Ltd (2019) SCIMAP por Sim Reaney, Durham University estÃ¡ licenciada bajo la licencia Creative Commons AtribuciÃ³n-NoComercial-CompartirIgual 3.0 Unported"}},wind_erosion_risk:{wms_name:"colombia_eo4_cultivar:colombia_wind_soil_erosion_risk",legend_styles:[],short_title:{en:"Risk of soil erosion caused by wind",es:"Riesgo de erosiÃ³n del suelo causado por el viento"},info_sections:[{section_title:{en:"Risk of soil erosion caused by wind",es:"Riesgo de erosiÃ³n del suelo causado por el viento"},section_content:{en:"<i>Ecosystem services: Conservation of soil and water quality. Limiting sediment entering rivers.</i>",es:"<i>Servicios ecosistÃ©micos: conservaciÃ³n del suelo y calidad del agua. LimitaciÃ³n de los sedimentos que entran a los rÃ­os.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"Orange colours are places where soils are susceptible to wind erosion, with dark orange places being most susceptible.",es:"El color naranja seÃ±ala los sitios donde los suelos son susceptibles a la erosiÃ³n eÃ³lica, mientras que los de color naranja oscuro muestran una mayor susceptibilidad."}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"Topsoil erosion risk is a significant factor leading to loss of soil, soil quality degradation, reduction in agricultural productivity, and siltation of rivers and streams. Some soil types are more susceptible to wind erosion due to their texture, stoniness and organic matter content.",es:"El riesgo de erosiÃ³n de la capa arable es un factor significativo que conlleva a la pÃ©rdida del suelo, la degradaciÃ³n de la calidad del suelo, reducciÃ³n en la productividad agrÃ­cola y sedimentaciÃ³n de los rÃ­os y arroyos. Algunos tipos de suelo son mÃ¡s susceptibles a la erosiÃ³n eÃ³lica debido a su textura, pedregosidad y contenido de materia orgÃ¡nica."}},{section_title:{en:"Why it is important:",es:"Por quÃ© es importante:"},section_content:{en:"Soil is a non-renewable resource and where it is lost through erosion, it can take hundreds to thousands of years to re-form. Losing topsoil removes a nutrient-rich growing-medium for plants, and also reduces the water infiltration capacity of the soil, leading to increased runoff. Land use management can have a large influence on wind erosion, particularly if vegetation cover is removed from dry, susceptible soils when erosive winds are likely to occur.",es:"El suelo es un recurso no renovable y en donde se haya perdido por erosiÃ³n puede tomar de cientos a miles de aÃ±os para volver a formarse. La pÃ©rdida de la capa arable elimina un medio de cultivo para plantas rico en nutrientes y tambiÃ©n reduce la capacidad de infiltraciÃ³n de agua en el suelto lo cual conlleva a una escorrentÃ­a incrementada. La gestiÃ³n del uso de suelos puede tener una gran influencia en la erosiÃ³n eÃ³lica, especialmente si se elimina la cobertura vegetal de suelos secos y susceptibles cuando es probable que ocurran vientos erosivos."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:"This map is based on an analysis of soil characteristics as mapped within the Digital Soil Map of the Department of Magdalena, Republic of Colombia. Scale 1: 100,000 (2009). Soil classes and their relative abundances were assessed for their susceptibility to wind erosion, so that soils with the highest risk and which are present in over 60% of an area, are given the highest risk. Areas where the same soil type is present, but in lower proportions, are assessed as lower risk.",es:"Este mapa estÃ¡ basado en un anÃ¡lisis de caracterÃ­sticas de suelo segÃºn estÃ¡ mapeado dentro del Mapa Digital de Suelos del Departamento del Magdalena, Colombia. Escala 1: 100,000 (2009). Las clases de suelo y sus abundancias relativas fueron evaluadas por su susceptibilidad a la erosiÃ³n eÃ³lica de tal manera que los suelos con mÃ¡s alto riesgo y que estÃ¡n presentes en un 60% del Ã¡rea son los que obtienen el mÃ¡s alto riesgo."}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019). Soil data: Geographic Institute AgustÃ­n Codazzi",es:"Datos y mapas creados por Environment Systems Ltd (2019). Datos de suelo: Instituto GeogrÃ¡fico AgustÃ­n Codazzi"}},key_biodiversity_habitats:{wms_name:"colombia_eo4_cultivar:colombia_habitat_network_sources",legend_styles:[],short_title:{en:"Places with habitat of key importance for biodiversity",es:"Sitios con hÃ¡bitat de importancia clave para la biodiversidad"},info_sections:[{section_title:{en:"Places with habitat of key importance for biodiversity",es:"Sitios con hÃ¡bitat de importancia clave para la biodiversidad"},section_content:{en:"<i>Ecosystem services: Population maintenance & genetic diversity.</i>",es:"<i>Servicios ecosistÃ©micos: mantenimiento de la poblaciÃ³n & diversidad genÃ©tica.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"The map shows existing areas of natural or semi-natural grassland, wetland and woodland that are important for supporting biological and genetic diversity. Areas of disturbed woodland are not included as they are likely to be less diverse than undisturbed woodland.",es:"El mapa muestra Ã¡reas existentes de pastizales, humedales o bosques naturales o semi-naturales que son importantes para apoyar la diversidad biolÃ³gica y genÃ©tica. Las Ã¡reas de bosque intervenido no han sido incluidas ya que es probable que sean menos diversas que las que no han sido intervenidas."}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"The map shows areas of natural or semi-natural vegetation, that are likely to support populations of a wide range of species, and high overall biodiversity. Biodiversity is a supporting service which underpins many other ecosystem services such as soil quality, pollination, food provision and surface water regulation.",es:"El mapa muestra Ã¡reas de vegetaciÃ³n natural o semi-natural que son proclive a apoyar poblaciones de una amplia variedad de especies y una alta biodiversidad en general. La biodiversidad es un servicio de apoyo que respalda muchos otros servicios ecosistÃ©micos, tales como la calidad del suelo, la polinizaciÃ³n, el suministro de alimentos y la regulaciÃ³n del agua superficial."}},{section_title:{en:"Why it is important:",es:"Por quÃ© es importante:"},section_content:{en:"These habitats are core components of the ecological networks, which facilitate gene flow between species populations and increase ecological resilience to disturbances such as land management and climate change. Natural and semi-natural habitats function as a complete system and so generally provide a higher level of ecosystem services than less natural and structurally diverse habitats. Loss of these habitats would reduce the ecological resilience, and have an impact on related ecosystem services, such as the ability of land to regulate surface water runoff, and habitat for pollinators.",es:"Estos hÃ¡bitats son los elementos bÃ¡sicos de las redes ecolÃ³gicas lo cual facilita el flujo genÃ©tico entre las poblaciones de especies y aumenta la resiliencia ecolÃ³gica frente a disturbios como el manejo territorial y el cambio climÃ¡tico. Los hÃ¡bitats naturales y seminaturales funcionan como un sistema completo y, por lo tanto, generalmente brindan un mayor nivel de servicios ecosistÃ©micos que los hÃ¡bitats estructuralmente diversos y menos naturales. La pÃ©rdida de estos hÃ¡bitats disminuirÃ­a la resiliencia ecolÃ³gica y, ademÃ¡s, tendrÃ­a un impacto en los servicios ecosistÃ©micos relacionados tales como, en la habilidad de la tierra para regular la escorrentÃ­a superficial y en el hÃ¡bitat para los polinizadores."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:"The habitat classes were generated using Sentinel 1 and Sentinel 2 satellite imagery. The map has been created at the strategic scale and is indicative at a field level. Field visits should be undertaken before any specific management decisions are taken.",es:"Las clases de hÃ¡bitat fueron generadas usando imÃ¡genes satelitales Sentinel 1 y Sentinel 2. El mapa ha sido creado a escala estratÃ©gica y es indicativo a nivel de campo. Se deben llevar a cabo visitas de campo antes de tomar cualquier decisiÃ³n de manejo especÃ­fica."}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019)",es:"Datos y mapas creados por Environment Systems Ltd (2019)"}},key_ecosystem_service_areas:{wms_name:"colombia_eo4_cultivar:colombia_important_benefit_areas",legend_styles:[],short_title:{en:"Places delivering multiple ecosystem service benefits: key areas for biodiversity and surface water regulation",es:"Sitios que ofrecen mÃºltiples beneficios de servicios ecosistÃ©micos: Ã¡reas clave para la biodiversidad y la regulaciÃ³n de aguas superficiales"},info_sections:[{section_title:{en:"Places delivering multiple ecosystem service benefits: key areas for biodiversity and surface water regulation",es:"Sitios que ofrecen mÃºltiples beneficios de servicios ecosistÃ©micos: Ã¡reas clave para la biodiversidad y la regulaciÃ³n de aguas superficiales"},section_content:{en:"<i>Ecosystem services: Population maintenance & genetic diversity. Regulation of overland flow.</i>",es:"<i>Servicio ecosistÃ©mico: Mantenimiento de la poblaciÃ³n & diversidad genÃ©tica. RegulaciÃ³n de la escorrentÃ­a superficial.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"The map identifies areas of source habitat (grassland, woodland, wetland) which coincide with areas providing high surface water regulation.",es:"El mapa identifica las Ã¡reas de hÃ¡bitat fuente (pastizales, bosque, humedales) las cuales coinciden con las Ã¡reas que brindan una alta regulaciÃ³n de aguas superficiales."}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"Source habitats function as the core of ecological networks. The structure and naturalness of the vegetation in these areas provides high biodiversity value. These vegetation characteristics combine with characteristics of the soil, geology and slope and together they provide high levels of surface water regulation. Biodiversity is a supporting service which underpins many other ecosystem services such as soil quality, pollination and food provision. Surface water regulation is a form of natural flood management, where hydrological and morphological processes, together with the habitat features, work together to manage the sources and pathways for flood waters.",es:"Los hÃ¡bitats fuente cumplen la funciÃ³n de ser el nÃºcleo de las redes ecolÃ³gicas. La estructura y la naturalidad de la vegetaciÃ³n en estas Ã¡reas ofrecen un alto valor de biodiversidad. Estas caracterÃ­sticas de vegetaciÃ³n se combinan con caracterÃ­sticas del suelo, geologÃ­a y pendiente, y juntas brindan altos niveles de regulaciÃ³n de las aguas superficiales. La biodiversidad es un servicio de apoyo que respalda muchos otros servicios ecosistÃ©micos tales como: la calidad del suelo, polinizaciÃ³n y el suministro de alimentos. La regulaciÃ³n de las aguas superficiales es una forma natural de manejar las inundaciones donde los procesos morfolÃ³gicos e hidrolÃ³gicos, en conjunto con las caracterÃ­sticas del hÃ¡bitat, trabajan para asÃ­ manejar las fuentes y las vÃ­as de las aguas de inundaciones."}},{section_title:{en:"Why it is important:",es:"Por quÃ© es importante:"},section_content:{en:"Surface water regulation and biodiversity are important ecosystem services in their own right. However, places providing high levels of multiple ecosystem services could be considered more valuable than those providing a single ecosysterm service. The protection of places of high biodiversity value that also provide high levels of natural flood management is likely to be a good investment.",es:"La regulaciÃ³n de aguas superficiales y la biodiversidad son servicios ecosistÃ©micos importantes por sÃ­ mismos. Sin embargo, los sitios que brindan altos niveles de mÃºltiples servicios ecosistÃ©micos podrÃ­an ser considerados de mÃ¡s valor que aquellos que brindan un solo servicio ecosistÃ©mico. Es de esperar que la protecciÃ³n de estos lugares de alto valor de biodiversidad, que tambiÃ©n brindan altos niveles de gestiÃ³n natural de inundaciones, sea una buena inversiÃ³n."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:'This map was derived by combining information from two other ecosystem service maps in this series: "Ability of the land to moderate surface water runoff" and "Places with habitat of key importance for biodiversity".',es:'Este mapa se generÃ³ de la combinaciÃ³n de informaciÃ³n de otros dos mapas de servicios ecosistÃ©micos en estas series: "La habilidad del suelo para regular la escorrentÃ­a superficial" y "Sitios con hÃ¡bitat de importancia clave para la biodiversidad".'}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019)",es:"Datos y mapas creados por Environment Systems Ltd (2019). Datos de suelo: Instituto GeogrÃ¡fico AgustÃ­n Codazzi"}},multi_benefit_ecological_opportunities:{wms_name:"colombia_eo4_cultivar:colombia_multibenefit_opportunities_habitat_water_regulation",legend_styles:[],short_title:{en:"Opportunities to deliver multiple ecosystems services in the Rio Frio catchment: ecological connectivity and surface water regulation",es:"Oportunidades para entregar servicios de ecosistemas mÃºltiples en la cuenca del rÃ­o Frio: conectividad ecolÃ³gica y regulaciÃ³n de aguas superficiales"},info_sections:[{section_title:{en:"Opportunities to deliver multiple ecosystems services in the Rio Frio catchment: ecological connectivity and surface water regulation",es:"Oportunidades para entregar servicios de ecosistemas mÃºltiples en la cuenca del rÃ­o Frio: conectividad ecolÃ³gica y regulaciÃ³n de aguas superficiales"},section_content:{en:"<i>Ecosystem services: Regulation of overland flow. Population maintenance & genetic diversity.</i>",es:"<i>Servicios EcosistÃ©micos: RegulaciÃ³n de la escorrentÃ­a superficial. Mantenimiento de la poblaciÃ³n & diversidad genÃ©tica.</i>"}},{section_title:{en:"How to interpret the map:",es:"CÃ³mo interpretar el mapa:"},section_content:{en:"The map shows places where it should be possible to restore or create new habitat to strengthen the existing grassland, wetland or woodland ecological networks to enhance biodiversity, while simultaneously enhancing the level of surface water regulation.",es:"El mapa muestra los lugares donde deberÃ­a ser posible restaurar o crear un nuevo hÃ¡bitat para fortalecer las redes ecolÃ³gicas existentes de pastizales, humedales o bosque con el fin de mejorar la biodiversidad, al mismo tiempo que se mejora el nivel de regulaciÃ³n de las aguas superficiales."}},{section_title:{en:"What the service is:",es:"CuÃ¡l es el servicio:"},section_content:{en:"Biodiversity is a supporting service which underpins many other ecosystem services such as soil quality, pollination and food provision. Surface water regulation is a form of natural flood management, which manages the sources and pathways for flood waters.",es:"La biodiversidad es un servicio de apoyo que sustenta muchos otros servicios ecosistÃ©micos, tales como la calidad del suelo, la polinizaciÃ³n y el suministro de alimentos. La regulaciÃ³n de las aguas superficiales es una forma de gestiÃ³n natural de las inundaciones que gestiona las fuentes y las vÃ­as de evacuaciÃ³n de estas."}},{section_title:{en:"Why is it important:",es:"Por quÃ© es importante:"},section_content:{en:"Surface water regulation and biodiversity are important ecosystem services in their own right. However, identifying places which provide high levels of multiple ecosystem services can help to inform the decision-making process when prioritising areas for land management action, in order to provide best value-for-money.",es:"La regulaciÃ³n de las aguas superficiales y la biodiversidad son servicios ecosistÃ©micos importantes por sÃ­ mismos. Sin embargo, la identificaciÃ³n de lugares que proporcionen altos niveles de mÃºltiples servicios ecosistÃ©micos puede ayudar a informar el proceso de toma de decisiones a la hora de priorizar Ã¡reas de acciÃ³n para la gestiÃ³n del suelo, con el fin de proporcionar la mejor relaciÃ³n calidad-precio."}},{section_title:{en:"How the map was created:",es:"CÃ³mo se creÃ³ el mapa:"},section_content:{en:'This map is derived by combining information from two other ecosystem service maps in this series: "Opportunities to enhance surface water regulation in the Rio Frio catchment" and "Opportunities to strengthen ecological networks". It identifies places that could be restored to support the ecological networks, and which currently provide relatively low surface water regulation.',es:'Este mapa se obtiene combinando la informaciÃ³n de otros dos mapas de servicios ecosistÃ©micos de esta serie: "Oportunidades para mejorar la regulaciÃ³n de las aguas superficiales en la zona de captaciÃ³n del RÃ­o FrÃ­o" y "Oportunidades para fortalecer las redes ecolÃ³gicas". Identifica los lugares que podrÃ­an ser restaurados para apoyar las redes ecolÃ³gicas, y que actualmente proporcionan una regulaciÃ³n de aguas superficiales relativamente baja.'}}],attribution:{en:"Data and maps created by Environment Systems Ltd (2019). Soil data: Geographic institute Agustin Codazzi. Sentinel-2 image: European Space Agency - ESA",es:"Datos y mapas creados por Environment Systems Ltd (2019). Datos de suelo: Instituto GeogrÃ¡fico Agustin Codazzi. Imagen del Sentinel-2: Agencia Espacial Europea - ESA"}}},overlay_layers:{grid_5k:{wms_name:"",display_legend:!1,display_sidebar:!1,short_title:{en:"5k grid square with summary data",es:"Ãrea de interÃ©s central (5km2) â Resumen de la data"},info_sections:[],attribution:{en:"JNCC",es:"JNCC"}},zona_bananera:{wms_name:"colombia_eo4_cultivar:colombia_aoi_main_catchment",display_legend:!1,display_sidebar:!0,short_title:{en:"Zona Bananera",es:"Zona Bananera"},info_sections:[],attribution:{en:"JNCC and Environment Systems with Assistance from ASBAMA, Tecbaco and Fundeban",es:"JNCC and Environment Systems with Assistance from ASBAMA, Tecbaco and Fundeban"}},rio_frio:{wms_name:"colombia_eo4_cultivar:opportunities_aoi_rio_frio_catchment",display_legend:!1,display_sidebar:!0,short_title:{en:"Rio Frio catchment",es:"Cuenca del RÃ­o FrÃ­o"},info_sections:[],attribution:{en:"JNCC and Environment Systems with Assistance from ASBAMA, Tecbaco and Fundeban",es:"JNCC and Environment Systems with Assistance from ASBAMA, Tecbaco and Fundeban"}}},underlay_layers:{satellite_imagery:{wms_name:"colombia_eo4_cultivar:satellite_imagery",display_legend:!1,short_title:{en:"Satellite imagery",es:"ImÃ¡genes satelitales"},attribution:{en:"Landsat-8 image courtesy of the USGS",es:"Imagen del Landsat-8 cortesÃ­a del USGS"}}}};
